css:
@-moz-document url-prefix("http://www.gdgzoi.com"), url-prefix("http://gdgzoi.com") {
    body {
        background-color: #000 !important;
        color: #97a0b3;
    }

    a,
    h1,
    h2,
    h3,
    h4,
    h5,
    strong {
        color: #808a9d;
    }

    div.col-xs-6:nth-child(2) > a:nth-child(1),
    div.col-xs-6:nth-child(1) > a:nth-child(1) {
        color: #808a9d !important;
    }

    .wrapper,
    .content-wrapper,
    .progress,
    .pagination > li > a {
        background-color: #222d32 !important;
    }

    .box,
    .table-striped > tbody > tr,
    .table,
    .box-footer,
    .well,
    .modal-content,
    .markdown-body {
        background-color: #2e383c !important;
    }

    .panel {
        background-color: #3b464a !important;
        border: none;
    }

    .main-footer,
    .user-body,
    .user-footer {
        background-color: #313a3f !important;
        color: #97a0b3;
    }

    .hd,
    .bd {
        background-color: #4e585b !important;
    }

    .box,
    .box-footer,
    .markdown-body {
        border-top: none !important;
        color: #97a0b3;
    }

    input[type="text"],
    input[type="password"],
    select {
        background-color: #313a3f !important;
        border: 1px solid !important;
        border-color: #414c51 !important;
        color: #97a0b3;
    }

    td,
    th {
        border-color: #4e585b !important;
    }

    .panel-success > .panel-heading {
        background-color: #697671;
        color: #92a292;
    }

    .list-group-item-info,
    .panel-info > .panel-heading {
        color: #a6b1b7;
        background-color: #68767c;
        border: none;
    }

    .pagination > li > a {
        border-color: #414c51 !important;
    }

    .modal-header,
    .modal-body,
    .modal-footer {
        border: none;
    }

    pre,
    code,
    .syntaxhighlighter table td.gutter .line,
    .syntaxhighlighter .line.alt2,
    .syntaxhighlighter .line.alt1,
    .linenums,
    .ace-chrome,
    .ace_gutter-layer,
    li.L0,
    li.L1,
    li.L2,
    li.L3,
    li.L4,
    li.L5,
    li.L6,
    li.L7,
    li.L8,
    li.L1,
    li.L3,
    li.L5,
    li.L7,
    li.L9 {
        background-color: #22262f !important;
    }

    .ace-chrome .ace_indent-guide {
        background: none;
        border-right: 1px solid #808a9d;
    }

    .ace_gutter-layer,
    .ace-chrome .ace_cursor {
        color: #808a9d;
    }

    .ace_gutter-active-line,
    .ace_active-line {
        background-color: #191e2a !important;
        color: #97a0b3;
    }

    .ace-chrome .ace_marker-layer .ace_selection {
        background-color: #33415E !important;
    }

    .ace_selected-word {
        border-radius: 3px;
        outline: none !important;
        border: none !important;
        background: transparent !important;
    }

    .ace_print-margin {
        visibility: hidden !important;
    }
}
